import React, { Fragment, useState } from "react";

const NavBar = ({ setStep }) => {
  return (
    <Fragment>
      <div>
        <ul>
          <li onClick={() => setStep(0)}>Home</li>
          <li onClick={() => setStep(1)}>Tasks</li>
          <li onClick={() => setStep(2)}>User</li>
        </ul>
      </div>
    </Fragment>
  );
};
export default NavBar;
